import React, { useState } from 'react';
import './App.css';
import HeroSection from './Components/HeroSection.js';
import CssBaseline from '@material-ui/core/CssBaseline';
import NavBar from './Components/NavBar.js';
import Resume from './Components/Resume.js';
import Portfolio from "./Components/Portfolio.js";
import AboutMe from "./Components/AboutMe.js";
import BGTexture from './images/pipes.png';


import { Route } from "react-router-dom";


function App() {


  return (
    <div className="App" style={{ backgroundImage: `url(${BGTexture})` }}>
      <CssBaseline />
      <Route path="/" exact render={props => <HeroSection {...props} />} />
      <Route path="/" exact render={props => <AboutMe {...props} />} />

      <Route path="/" render={props => <NavBar {...props} />} />

      <Route path="/portfolio" exact render={props => <Portfolio {...props} />} />
      <Route path="/resume" render={props => <Resume {...props} />} />
    </div>
  );
}

export default App;
